import React from 'react';
import './article.css';

const Article = ( {imgURL, date, title} ) => {
	return (
		<div className='omntech__blog-container_article'>
			<div className='omntech__blog-container_article-image'>
				<img src={imgURL} alt="blog" />
			</div>
			<div>
				<p>{date}</p>
				<h3>{date}</h3>
			</div>
		</div>
	)
}

export default Article
